      <name id="64" justification="1" size="4" underlined="false">
        <text>&lt;font size=&quot;5&quot;&gt;
TrailQueueDecisionTree orders
Trials in the following order;
1) Non approved trials first,
   which may seem counter intuitive,
   but since they don&apos;t even run they don&apos;t 
   effect other trials.
2) SourceFileTrials second by  
      sourceClass ClassDependenciesLocal
3) ApiTrais third
4) UseCaseTrias fourth
5) MetaTrail last
&lt;br/&gt;

This is primarally so that code coverage
can be accrately calculated by making sure
that a condition &lt;i&gt;&apos;innacurate sourceClass code coverage 
from thread overlap&apos;&lt;/i&gt; does not occur.  This should
also help to ensure that bugs in the most depended classes
are discovered before bug identification diagnosis 
occurs (aka. dev time) in higher level classes.
&lt;/font&gt;</text>
      </name>
